import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';

function AdminPage() {
    const navigate = useNavigate();
    const [submissions, setSubmissions] = useState([]);
    const [dropdown, setDropdown] = useState('All');
    const [filteredSubmissions, setFilteredSubmissions] = useState([]);

    // Dummy data for testing formatting
    const dummySubmissions = [
        {
            status: 'New',
            name: 'John Doe',
            email: 'john.doe@example.com',
            description: 'Description for John Doe',
            createdAt: '2023-04-01',
            updatedAt: '2023-04-02'
        },
        {
            status: 'In Progress',
            name: 'Jane Smith',
            email: 'jane.smith@example.com',
            description: 'Description for Jane Smith',
            createdAt: '2023-04-03',
            updatedAt: '2023-04-04'
        },
    ];

    useEffect(() => {

        const fetchData = async () => {
            try {
                const response = await axios.get('http://localhost:3001/submit');
                setSubmissions(response.data);
            } catch (error) {
                console.error('Error fetching submissions:', error);
            }
        };
        fetchData();
    }, []);

    const handleDropdown = (choice) => {
        setDropdown(choice);
        if (choice === 'All') {
            setFilteredSubmissions(submissions);
        } else {
            const filtered = submissions.filter(submission => submission.status === choice);
            setFilteredSubmissions(filtered);
        }
    };

    const getStatusColor = (status) => {
        switch (status) {
            case 'New':
                return 'hsl(0, 100%, 75%)';
            case 'In Progress':
                return 'hsl(60, 100%, 75%)';
            case 'Resolved':
                return 'hsl(120, 100%, 75%)';
            default:
                return 'none';
        }
    };

    return (
        <div class="parent">
            <div class="container">
                <div class="row">
                    <div class="col-12 d-flex justify-content-end mt-3">
                        <button onClick={() => navigate('/')} type="button" class="btn btn-primary">Return to Ticket Entry</button>
                    </div>
                </div>
            </div>
            <div class="container pt-5">
                <div class="row justify-content-md-center">
                    <div class="col-12 col-md-10 col-lg-8 col-xl-7 col-xxl-6">
                        <h2 class="mb-4 display-5 text-center">Admin Dashboard</h2>
                        <hr class="w-50 mx-auto mb-5 mb-xl-9 border-dark-subtle" />
                    </div>
                </div>
            </div>
            <div class="mx-5 pb-3">
                <div class="dropdown">
                    <button class="btn btn-secondary dropdown-toggle" type="button" data-bs-toggle="dropdown" aria-expanded="false">
                        {dropdown}
                    </button>
                    <ul class="dropdown-menu">
                        <li><a class="dropdown-item" href="#" onClick={() => handleDropdown('All')}>All</a></li>
                        <li><a class="dropdown-item" href="#" onClick={() => handleDropdown('New')}>New</a></li>
                        <li><a class="dropdown-item" href="#" onClick={() => handleDropdown('In Progress')}>In Progress</a></li>
                        <li><a class="dropdown-item" href="#" onClick={() => handleDropdown('Resolved')}>Resolved</a></li>
                    </ul>
                </div>
            </div>
            <div class="mx-5 justify-content-center ">
                <table class="table rounded border">
                    <thead>
                        <tr>
                            <th scope="col">Status</th>
                            <th scope="col">Name</th>
                            <th scope="col">Email</th>
                            <th scope="col">Description</th>
                            <th scope="col">Created At  <i class="bi bi-arrow-down-up"></i></th>
                            <th scope="col">Updated At </th>
                        </tr>
                    </thead>
                    <tbody>
                        {dummySubmissions.map((submission, index) => (
                            <tr key={index}>
                                <td style={{ backgroundColor: getStatusColor(submission.status) }}>{submission.status}</td>
                                <td>{submission.name}</td>
                                <td>{submission.email}</td>
                                <td>{submission.description}</td>
                                <td>{submission.createdAt}</td>
                                <td>{submission.updatedAt}</td>
                            </tr>
                        ))}
                    </tbody>
                </table>
            </div>

        </div>



        // <div>
        //     <h1>Admin Page</h1>
        //     <div style={{ display: 'flex', flexDirection: 'column', alignItems: 'center', marginTop: '50px' }}>
        //         <button style={{
        //             alignSelf: 'flex-end',
        //             padding: '10px 20px',
        //             fontSize: '16px',
        //             backgroundColor: '#007BFF',
        //             color: 'white',
        //             border: 'none',
        //             cursor: 'pointer',
        //             marginBottom: '20px'
        //         }} onClick={() => navigate('/')}>Go Back to Ticket Entry</button>
        //         <h2>Submissions</h2>
        //         <ul>
        //             {submissions.map((submission, index) => (
        //                 <li key={index}>
        //                     <strong>Name:</strong> {submission.name}, <strong>Email:</strong> {submission.email}, <strong>Description:</strong> {submission.description}
        //                 </li>
        //             ))}
        //         </ul>
        //     </div>
        // </div>
    );
}

export default AdminPage;
